// Get the output item of the previous node (AI Agent)
// We assume that the AI Agent only outputs one result
const item = $input.first();
const rawOutput = item.json.output;

try {
// Step 1: Clean the string and extract the pure JSON part
// AI output is usually wrapped with ```json ... ```
const startIndex = rawOutput.indexOf('{');
const endIndex = rawOutput.lastIndexOf('}');

// Throw an error if no valid JSON brackets are found
if (startIndex === -1 || endIndex === -1) {
throw new Error("No valid JSON object found in AI output.");
}

const jsonString = rawOutput.slice(startIndex, endIndex + 1);

// Step 2: Parse the cleaned string into a real JavaScript object
const parsedData = JSON.parse(jsonString);

// Steps 3: Build a new, flattened output object ready for storage
const result = {
title: parsedData.title,
slug: parsedData.slug,
meta_description: parsedData.meta_description,

// Key step: Processing JSONB fields
// Convert JS objects/arrays back to JSON strings for proper processing by the Supabase node
strategy_summary: JSON.stringify(parsedData.strategy_summary),
body: JSON.stringify(parsedData.article_body),
};

// Step 4: Return the processed result as the output of this node
// n8n expects an array of objects to be returned
return [{
json: result
}];

} catch (error) {
// If parsing fails, print an error to n8n's execution log and terminate the workflow
console.error("JSON parsing failed:", error);
console.error("Raw AI output:", rawOutput);
throw new Error("Unable to parse the JSON data returned by AI, please check the output of the AI ‚Äã‚ÄãAgent node.");
}

